import React from "react";
import Link from "next/link";
import styles from "../styles/Navbar.module.css";

export default function Navbar() {
  return (
    <div className={styles.navbar}>
      <Link href="" className={styles.navitem}>
        This page
      </Link>
    </div>
  );
}
